import ModPlannerImg from "../../Images/modplanner.png";
import JavascriptIcon from "../../Images/Javascript.png";
import HtmlIcon from "../../Images/html5.png";
import CssIcon from "../../Images/css3.png";
import ReactIcon from "../../Images/React.png";
import NodejsIcon from "../../Images/nodejs.png";

const Modplanner = {
  title: "The Mod Planner",
  shortDescription:
    "A web application that allows NUS students to plan their modules \
    ahead of time with access to module information, guides and a Q&A platform.",
  image: ModPlannerImg,
  description:
    "The website would be able to \
    Allow users to select and plan their path, similar to NUSMods\
    Allow users to submit advice - two ways\
    Users can submit reviews of specific modules as well as other user’s submitted module paths\
    Users can also share their personal module path for people to take reference from\
    Rating functionality (upvote/downvote) allows better and therefore, likely more useful, reviews to be easily accessed\
    ",
  links: [
    "https://github.com/Ziyang-98/NUS-University-Path-Planner",
    "mod-planner.herokuapp.com",
  ],
  techStack: [
    { name: "Javascript", img: JavascriptIcon },
    { name: "HTLM5", img: HtmlIcon },
    { name: "CSS3", img: CssIcon },
    { name: "ReactJS", img: ReactIcon },
    { name: "NodeJS", img: NodejsIcon },
  ],
};

export default Modplanner;
